fn tree_priority<T: MtKey>(tree: &ParamTreap<T>) -> i64 {
    let handle = tree.root.acquire_read();
    let result = handle.borrow().as_ref().map_or(i64::MIN, |node| node.priority);
    handle.release_read();
    result
}

